self.onmessage = (ev) => {
  const msg = ev.data || {};
  switch (msg.type) {
    case 'init':
      self.postMessage({ type: 'ready' });
      break;
    case 'ping':
      self.postMessage({ type: 'pong', t: Date.now() });
      break;
    default:
      // placeholder
      break;
  }
};
